const Main = () => {
  return (
    <main>
      <img src="/images/jakub-gorajek-AvhMrjYC8L8-unsplash.png" alt="" />
      <div className="overlay">
        <div className="container">
          <section>
            <p>Welcome</p>
            <h1>
              Empowering your everyday transactions making payment processing
              easy
            </h1>
            <input type="submit" value="Get Started  >" />
          </section>
        </div>
      </div>
    </main>
  );
};
export default Main;
